description:
Wildlife SOS is a long-running documentary series that follows the work of Wildlife Aid. The show is presented by co-founder Simon Cowell and veterinary nurse Sara Cowen. Simon is generally featured lampooning around the countryside rescuing wildlife, while Sara is in charge at the hospital looking after the patients during their stay. They are backed up by a dedicated team of vets, wildlife experts and over 120 volunteers, whose many and varied characters help to give the show its unique charm.

This release contains 82 episodes.

Audio 1: Russian
Audio 2: English
Video: Xvid ~1098 Kbps
Source: SATRip

